@Truth_n_Respect I wouldn't say Communist China is good. It just is. 

Marx actually thought the United States would be a the first, true communist (lower "c") state. And we still could be. Lower "c" communism is much better than upper "C" Communism. 

And you should know the difference.

@SStapczynski Right decision. Western countries developed on the back of cheap energy.

India, China and rest of the Asia are going to do the same.

Once Western countries reduce their energy consumption by 50%, we can talk about the environment
